import React from 'react'
import { useState, useEffect } from 'react'

function MyProdutos() {
    const [produtos, setProdutos] = useState([])


  return (
    <section>
        <h1>MyProdutos</h1>,

        <div>{produtos.length > 0 && <p>Meus produtos cadastrados</p>}</div>
    </section>

  )
}

export default MyProdutos
